const initState = {
    componentsData: {},
    creatorComponentsData: {}
}
export default function(state = initState, action){
    switch(action.type){
        case 'UPDATE_COMPONENTS_DATA': return { ...state, componentsData: action.payload }
        case 'UPDATE_CREATOR_COMPONENTS_DATA': return { ...state, creatorComponentsData: action.payload }
        default: return state;
    }
}
